import React from 'react';
import '../Styles/Navbar.css';
import '../Styles/Utility.css';
import AppLogo from '../Images/app-logo.png';
import BurgerIcon from './BurgerIcon';

const Navbar = (props) => {
  return (
    <header className='navbar'>
        <a href='#' className='navbar_logo'>
          <img src={AppLogo} alt="Logo" />
        </a>
        <nav>
          <ul className='navbar_menu'>
            <li>
              <a className='navbar_links' href="">DASHBOARD</a>
            </li>
            <li>
              <a className='navbar_links' href="">COMPLETED</a>
            </li>
            <li>
              <a className='navbar_links' href="">UPCOMING</a>
            </li>
            <li className='navbar_line'></li>
            <li>
              <button className='navbar_btn' type="button" onClick={props.toggleTheme}>
                <BurgerIcon />
              </button>
            </li>
          </ul>
          <button className='navbar_btn' id='mobile-navbar_btn'>
            <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke-width="1.5" stroke="currentColor">
              <path id='burger_icon' stroke-linecap="round" stroke-linejoin="round" d="M3.75 6.75h16.5M3.75 12h16.5M12 17.25h8.25" />
            </svg>
          </button>
        </nav>
    </header>
  );
};

export default Navbar;
